import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';
import './menu.css'

 class Menu extends React.Component {
  render() {
    return (
      <div className="barre">

        <p>DASHBOARD</p>
        <hr /> 
        <Nav vertical>
          <NavItem>
            <NavLink onClick='./App.js'>Menu</NavLink>
          </NavItem>
          <hr />  
          <NavItem>
            <NavLink onClick='./Contact/contact.js'>Contacts</NavLink>
          </NavItem>
          <hr />
        </Nav>

      </div>
    );
  }
}

export default Menu;
